import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import lessonicon from '../img/lessonicon.svg';
import '../App.css';

export default function Dashboard() {
	return (
		<article>
			<header>
				<NavbarTop />
			</header>
			<body>
				<div style={styles.container}>
					<LessonElement />
				</div>
			</body>
		</article>
	);
}

function LessonElement() {
	return (
		<div style={styles.container}>
			<img
				src={lessonicon}
				style={{
					position: 'absolute',
					height: '20vmin',
					background: '#b8c2ccff',
					borderRadius: '50%',
					padding: '15px',
					border: '20px solid #dae1e7ff'
				}}
			/>

			<p
				style={
					(styles.defaultFontFamily, { fontWeight: '700', color: '#606f7bff' })
				}
			>
				Basics training
			</p>
			<p>hi</p>
		</div>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonElement: {
		height: '15vmin'
	},
	container: {
		minHeight: '100vh',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	}
};
// export default Dashboard;
